text:
happy new year, my friends. i’m so grateful you're on this journey with me. we struggle, we survive, we thrive. together. ✒🖤 there are too many people to tag, but these are just a few who’ve made it possible for me to dive into this work (and who’ve jumped right into the deep end with me):
.
.
@twentyand3 - logo, creative brand collaboration, pure kindred spirithood, and divine empowerment.

@seattlecreativeworks - new website design and navigation (take a look via link in profile!), ux sanity, a fresh set of eyes, and extreme tolerance for the roller coaster "hey, what if we..." of working with yours truly.

@bsportraitographer - portraits that remind me of my capacity to be seen and to experience joy (and the best hugs in the biz). .
.
.
and @mcgeehanbob - the one who makes me possible, the one who - when i worry i’m not pulling my weight in the busy everyday of our home and family and marriage and life - reminds me that this work is exactly where i need to be, and exactly what i need to be doing.

tag someone you’re grateful for, drop a note about anything you want to say, and get ready for the first #twft52 prompt on january 6!

@thewordforthis .
[image: logo with while background and the words ""the word for this" in stylized black and teal type, featuring a dark teal fountain pen nib icon.]

